import React from "react"
import Navbar from "./Navbar"
import Home from "./Home"
import Footer from "./Footer"
import Navbarlinks from "./Navbarlinks"


class Main extends React.Component{

    render() {
        return(
            <div>
                 <Navlinks/>
                <Navbar/>
                <Home/>
                <Footer/>
            </div>
        )
    }
}

export default Main;
